import React, { useState } from "react";

import "./Filter.scss";

export default function Filter() {
  return (
    <div className="filter">
      <div className="filter-where">
        <label for="where-input" className="filter-where-label">
          Tìm theo địa điểm
        </label>
        <input id="where-input" type="text" className="filter-where-input" />
      </div>
      <div className="filter-price">
        <label className="filter-price-label">Tìm theo khoảng giá</label>
        <select>
          <option>500.000 - 2.000.000</option>
        </select>
      </div>
    </div>
  );
}
